import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import Transition from "./components/transition";
import TransitionDos from "./components/transition2";
import UseDeffered from "./components/useDefferedTest";
import DefferedDos from "./components/useDefferedValue2";

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
  },
  {
    path: "/transition",
    element: <Transition />,
  },
  {
    path: "/transition2",
    element: <TransitionDos />,
  },
  {
    path: "/deffered",
    element: <UseDeffered />,
  },
  {
    path: "/deffered2",
    element: <DefferedDos />,
  },
]);

/**
 * ðŸ‘´ Old way to mount and unmount an app
 */

// const rootNode = document.getElementById("root");
// ReactDOM.render(
//   <React.StrictMode>
//     <RouterProvider router={router} />
//   </React.StrictMode>,
//   rootNode
// );

// ReactDOM.unmountComponentAtNode(rootNode);

/**
 * ðŸš€ New way with the react-dom/client API
 */

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);

root.unmount();
